import React from 'react';
import Header from './component/Header';
import Footer from './component/Footer';

import './App.css';

function App() {

  return (
    <div className="App">
      <div id="wrapper" className="home-page">
        <Header />
        <Footer />
      </div>
    </div>
  );
}

export default App;
